import React from "react";
import "./Footer.css";
function Footer() {
  return (
    <div className="footer">
      <p>@copyright 2023</p>
      <p>
        Designed & Built by <a href="https://github.com/nurazad">Nendy</a>
      </p>
    </div>
  );
}

export default Footer;
